,p_plsql_code=>wwv_flow_string.join(wwv_flow_t_varchar2(
'-- =============================================================================',
'--',
'--  FOS = FOEX Open Source (fos.world), by FOEX GmbH, Austria (www.foex.at)',
'--',
'--  This plug-in shows other settings of other plug-ins like page designer.',
'--',
'--  License: restricted - for FOS internal use only',
'--',
'--  GitHub: -',
'--',
'-- =============================================================================',
'',
'--------------------------------------------------------------------------------',
'--',
'--------------------------------------------------------------------------------',
'function get_page_data',
'  ( p_mode        in varchar2',
'  , p_inc_values  in varchar2',
'  , p_app_id      in varchar2',
'  , p_page_id     in varchar2',
'  , p_val_page_id in varchar2',
'  , p_plugin_name in varchar2',
'  )',
'return clob',
'as',
'    l_result            clob;',
'    l_app_id            varchar2(100) := p_app_id;',
'    l_page_id           varchar2(100);',
'',
'    l_plugin_type       varchar2(100);',
'',
'    cursor_regions      sys_refcursor;',
'    cursor_das          sys_refcursor;',
'    cursor_da_acts      sys_refcursor;',
'    cursor_proc         sys_refcursor;',
'    cursor_pl           sys_refcursor;',
'    cursor_pl_attr      sys_refcursor;',
'    cursor_pl_attr_val  sys_refcursor;',
'    cursor_pl_std_attrs sys_refcursor;',
'    cursor_pl_events    sys_refcursor;',
'',
'begin',
'    if p_mode = ''page-designer''',
'    then',
'        l_page_id := p_page_id;',
'    else',
'        l_page_id := p_val_page_id;',
'        ',
'        select plugin_type',
'          into l_plugin_type',
'          from apex_appl_plugins',
'         where application_id = l_app_id',
'           and name           = p_plugin_name',
'        ;',
'    end if;',
'    ',
'    -- Plug-in data',
'    open cursor_pl',
'     for select plugin_id',
'--              , workspace',
'--              , workspace_display_name',
'--              , application_id',
'--              , application_name',
'              , plugin_type',
'              , name',
'              , display_name',
'--              , category',
'--              , supported_ui_types',
'--              , supported_component_types',
'--              , supported_data_types',
'--              , file_prefix',
'--              , javascript_file_urls',
'--              , css_file_urls',
'--              , plsql_code',
'--              , api_version',
'--              , render_function',
'--              , meta_data_function',
'--              , ajax_function',
'--              , validation_function',
'--              , execution_function',
'--              , session_sentry_function',
'--              , invalid_session_function',
'--              , authentication_function',
'--              , post_logout_function',
'--              , builder_validation_function',
'--              , migration_function',
'              , standard_attributes',
'--              , substitute_attributes',
'--              , is_subscribed',
'--              , subscribed_from',
'--              , subscribed_from_id',
'--              , subscribe_plugin_settings',
'              , help_text',
'--              , version_identifier',
'--              , about_url',
'--              , component_comment',
'--              , files_version',
'--              , created_by',
'--              , created_on',
'--              , last_updated_by',
'--              , last_updated_on',
'--              , component_signature',
'              , attribute_01',
'              , attribute_02',
'              , attribute_03',
'              , attribute_04',
'              , attribute_05',
'              , attribute_06',
'              , attribute_07',
'              , attribute_08',
'              , attribute_09',
'              , attribute_10',
'              , attribute_11',
'              , attribute_12',
'              , attribute_13',
'              , attribute_14',
'              , attribute_15',
'--              , sql_min_column_count',
'--              , sql_max_column_count',
'--              , sql_examples',
'           from apex_appl_plugins',
'          where application_id = l_app_id',
'            and name not in (''COM.FOS.PLUGIN_PREVIEW'',''COM.FOS.WEBSITE_METADATA_MARKUP'')',
'            and (',
'                    (',
'                        p_mode       = ''page-designer''',
'                    and (',
'                            name in ( select substr(action_code,8)',
'                                        from apex_application_page_da_acts',
'                                       where application_id  = l_app_id',
'                                         and page_id         = l_page_id',
'                                    )',
'                         or name in ( select substr(source_type_code,8)',
'                                        from apex_application_page_regions',
'                                       where application_id  = l_app_id',
'                                         and page_id         = l_page_id',
'                                    )',
'                        or name in ( select substr(process_type_code,8)',
'                                        from apex_application_page_proc',
'                                       where application_id  = l_app_id',
'                                         and page_id         = l_page_id',
'                                    )',
'                        )',
'                    )',
'                 or (',
'                         p_mode = ''plugin-showcase''',
'                     and name   = p_plugin_name',
'                    )',
'                )',
'    ;',
'    -- Plug-in standard attributes',
'    open cursor_pl_std_attrs',
'     for select --plugin_std_attribute_id',
'--              , workspace',
'--              , workspace_display_name',
'--              , application_id',
'--              , application_name',
'                plugin_id',
'--              , plugin_name',
'              , name',
'--              , is_required',
'              , default_value',
'--              , sql_min_column_count',
'--              , sql_max_column_count',
'--              , supported_ui_types',
'--              , supported_component_types',
'--              , depending_on_attribute_id',
'--              , depending_on_always_eval',
'--              , depending_on_condition_type',
'--              , depending_on_expression',
'              , examples',
'              , help_text',
'--              , component_comment',
'--              , created_by',
'--              , created_on',
'--              , last_updated_by',
'--              , last_updated_on',
'           from apex_appl_plugin_std_attrs',
'          where application_id = l_app_id',
'            and plugin_name  not in (''COM.FOS.PLUGIN_PREVIEW'',''COM.FOS.WEBSITE_METADATA_MARKUP'')',
'            and (',
'                    (',
'                        p_mode = ''page-designer''',
'                    and (',
'                        plugin_name in (  select substr(action_code,8)',
'                                            from apex_application_page_da_acts',
'                                           where application_id = l_app_id',
'                                             and page_id        = l_page_id',
'                                       )',
'                     or plugin_name in (  select substr(source_type_code,8)',
'                                            from apex_application_page_regions',
'                                           where application_id = l_app_id',
'                                             and page_id        = l_page_id',
'                                       )',
'                     or plugin_name in ( select substr(process_type_code,8)',
'                                           from apex_application_page_proc',
'                                          where application_id  = l_app_id',
'                                            and page_id         = l_page_id',
'                                       )',
'                    )',
'                 or p_mode = ''plugin-showcase''',
'                and plugin_name = p_plugin_name        ',
'           ))',
'    ;',
'    -- Plug-in attributes',
'    open cursor_pl_attr',
'     for select plugin_attribute_id',
'--              , workspace',
'--              , workspace_display_name',
'--              , application_id',
'--              , application_name',
'              , plugin_id',
'--              , plugin_name',
'--              , attribute_scope',
'              , attribute_sequence',
'              , display_sequence',
'              , prompt',
'              , attribute_type',
'              , is_required',
'--              , is_common',
'--              , show_in_wizard',
'              , default_value',
'--              , display_length',
'--              , max_length',
'--              , min_value',
'--              , max_value',
'--              , unit',
'--              , sql_min_column_count',
'--              , sql_max_column_count',
'--              , column_data_types',
'--              , supported_ui_types',
'--              , supported_component_types',
'--              , is_translatable',
'              , depending_on_attribute_id',
'--              , depending_on_comp_prop_id',
'--              , depending_on_always_eval',
'              , depending_on_condition_type',
'              , depending_on_expression',
'--              , reference_scope',
'              , examples',
'              , help_text',
'--              , component_comment',
'--              , created_by',
'--              , created_on',
'--              , last_updated_by',
'--              , last_updated_on',
'           from apex_appl_plugin_attributes',
'          where application_id  = l_app_id',
'            and plugin_name   not in (''COM.FOS.PLUGIN_PREVIEW'',''COM.FOS.WEBSITE_METADATA_MARKUP'')',
'            and attribute_scope = ''Component''',
'            and (',
'                    (',
'                        p_mode = ''page-designer''',
'                    and (',
'',
'                            plugin_name in ( select substr(action_code,8)',
'                                               from apex_application_page_da_acts',
'                                              where application_id = l_app_id',
'                                                and page_id        = l_page_id',
'                                           )',
'                         or plugin_name in ( select substr(source_type_code,8)',
'                                               from apex_application_page_regions',
'                                              where application_id = l_app_id',
'                                                and page_id        = l_page_id',
'                                           )',
'                         or plugin_name in ( select substr(process_type_code,8)',
'                                               from apex_application_page_proc',
'                                              where application_id  = l_app_id',
'                                                and page_id         = l_page_id',
'                                           )',
'                        )',
'                     or p_mode = ''plugin-showcase''',
'                    and plugin_name = p_plugin_name',
'               ))',
'       order by display_sequence',
'    ;',
'    -- Plug-in attribute values',
'    open cursor_pl_attr_val',
'     for select plugin_attribute_value_id',
'--              , workspace',
'--              , workspace_display_name',
'--              , application_id',
'--              , application_name',
'              , plugin_attribute_id',
'              , plugin_attribute_prompt',
'              , display_sequence',
'              , display_value',
'              , return_value',
'--              , is_quick_pick',
'              , help_text',
'--              , created_by',
'--              , created_on',
'--              , last_updated_by',
'--              , last_updated_on',
'           from apex_appl_plugin_attr_values',
'          where application_id       = l_app_id',
'            and plugin_attribute_id in ( select plugin_attribute_id',
'                                           from apex_appl_plugin_attributes',
'                                          where application_id = l_app_id',
'                                            and plugin_name   not in (''COM.FOS.PLUGIN_PREVIEW'',''COM.FOS.WEBSITE_METADATA_MARKUP'')',
'                                            and (',
'                                                    (',
'                                                        p_mode = ''page-designer''',
'                                                    and (',
'                                                            plugin_name in ( select substr(action_code,8)',
'                                                                               from apex_application_page_da_acts',
'                                                                              where application_id = l_app_id',
'                                                                                and page_id        = l_page_id',
'                                                                           )',
'                                                         or plugin_name in ( select substr(source_type_code,8)',
'                                                                               from apex_application_page_regions',
'                                                                              where application_id  = l_app_id',
'                                                                                and page_id         = l_page_id',
'                                                                           )',
'                                                         or plugin_name in ( select substr(process_type_code,8)',
'                                                                               from apex_application_page_proc',
'                                                                              where application_id  = l_app_id',
'                                                                                and page_id         = l_page_id',
'                                                                           )',
'                                                        )',
'                                                    )',
'                                                 or (',
'                                                         p_mode = ''plugin-showcase''',
'                                                     and plugin_name = p_plugin_name',
'                                                    )',
'                                                )',
'                                       )',
'       order by display_sequence',
'    ;',
'    -- in any case we need the plug-in data',
'    apex_json.initialize_clob_output;',
'    apex_json.open_object();',
'    apex_json.write(''plugin''        , cursor_pl);',
'    apex_json.write(''pluginStdAttr'' , cursor_pl_std_attrs);',
'    apex_json.write(''pluginAttr''    , cursor_pl_attr);',
'    apex_json.write(''pluginAttrVal'' , cursor_pl_attr_val);',
'    ',
'    -- get the plug-in settings only if it''s required',
'    if p_mode = ''page-designer'' or p_inc_values = ''Y''',
'    then',
'        -- Region',
'        if l_plugin_type = ''Region Type'' or p_mode = ''page-designer''',
'        then',
'            open cursor_regions',
'             for select region_name',
'                      , parent_region_id',
'                      , static_id',
'                      , display_sequence',
'                      , display_position_code',
'                      , region_source',
'                      , source_type',
'                      , source_type_code',
'                      , condition_type',
'                      , init_javascript_code',
'                      , attribute_01',
'                      , attribute_02',
'                      , attribute_03',
'                      , attribute_04',
'                      , attribute_05',
'                      , attribute_06',
'                      , attribute_07',
'                      , attribute_08',
'                      , attribute_09',
'                      , attribute_10',
'                      , attribute_11',
'                      , attribute_12',
'                      , attribute_13',
'                      , attribute_14',
'                      , attribute_15',
'                      , attribute_16',
'                      , attribute_17',
'                      , attribute_18',
'                      , attribute_19',
'                      , attribute_20',
'                      , attribute_21',
'                      , attribute_22',
'                      , attribute_23',
'                      , attribute_24',
'                      , attribute_25',
'                      , region_id',
'                   from apex_application_page_regions',
'                  where application_id = l_app_id',
'                    and page_id        = l_page_id',
'                  order by display_sequence',
'            ;',
'',
'            apex_json.write(''regions'', cursor_regions);',
'        end if;',
'        -- Dynamic Action    ',
'        if l_plugin_type = ''Dynamic Action'' or p_mode = ''page-designer''',
'        then',
'            open cursor_das',
'             for select dynamic_action_name',
'                      , dynamic_action_sequence',
'                      , when_element',
'                      , when_selection_type',
'                      , when_selection_type_code',
'                      , when_region',
'                      , when_button',
'                      , when_event_internal_name',
'                      , when_event_name',
'                      , when_event_custom_name',
'                      , when_condition',
'                      , when_expression',
'                      , when_event_scope',
'                      , condition_type',
'                      , condition_type_code',
'                      , dynamic_action_id',
'                   from apex_application_page_da',
'                  where application_id = l_app_id',
'                    and page_id        = l_page_id',
'               order by dynamic_action_sequence',
'            ;',
'',
'            open cursor_da_acts',
'             for select dynamic_action_id',
'                      , action_name',
'                      , action_code',
'                      , action_sequence',
'                      , dynamic_action_event_result',
'                      , execute_on_page_init',
'                      , affected_elements',
'                      , affected_elements_type',
'                      , affected_region',
'                      , affected_button',
'                      , init_javascript_code',
'                      , attribute_01',
'                      , attribute_02',
'                      , attribute_03',
'                      , attribute_04',
'                      , attribute_05',
'                      , attribute_06',
'                      , attribute_07',
'                      , attribute_08',
'                      , attribute_09',
'                      , attribute_10',
'                      , attribute_11',
'                      , attribute_12',
'                      , attribute_13',
'                      , attribute_14',
'                      , attribute_15',
'                      , stop_execution_on_error',
'                      , wait_for_result',
'                      , component_comment',
'                      , action_id',
'                   from apex_application_page_da_acts',
'                  where application_id = l_app_id',
'                    and page_id        = l_page_id',
'               order by action_sequence',
'            ;',
'            ',
'            open cursor_pl_events',
'             for select plugin_id',
'                      , name',
'                      , display_name',
'                   from apex_appl_plugin_events',
'                  where application_id = l_app_id ',
'            ;',
'            apex_json.write(''das'', cursor_das);',
'            apex_json.write(''daActs'', cursor_da_acts);',
'            apex_json.write(''pluginEvents'', cursor_pl_events);',
'        end if;',
'        -- Process',
'        if l_plugin_type = ''Process Type'' or p_mode = ''page-designer''',
'        then',
'            open cursor_proc',
'             for select process_name',
'                      , execution_sequence',
'                      , process_point_code',
'                      , process_type',
'                      , process_type_code',
'                      , process_type_plugin_name',
'                      , process_source',
'                      , attribute_01',
'                      , attribute_02',
'                      , attribute_03',
'                      , attribute_04',
'                      , attribute_05',
'                      , attribute_06',
'                      , attribute_07',
'                      , attribute_08',
'                      , attribute_09',
'                      , attribute_10',
'                      , attribute_11',
'                      , attribute_12',
'                      , attribute_13',
'                      , attribute_14',
'                      , attribute_15',
'                      , error_display_location',
'                      , condition_type',
'                      , component_comment',
'                      , process_id',
'                   from apex_application_page_proc',
'                  where application_id = l_app_id',
'                    and page_id = l_page_id',
'               order by execution_sequence  ',
'            ;',
'            apex_json.write(''proc'', cursor_proc);',
'        end if;',
'    end if;',
'',
'    apex_json.close_object;',
'',
'    l_result := apex_json.get_clob_output;',
'',
'    apex_json.free_output;',
'',
'    return l_result;',
'end get_page_data;',
'',
'',
