,p_help_text=>wwv_flow_string.join(wwv_flow_t_varchar2(
'<p>',
'This plug-in has been designed to show the plug-in settings for a particular region/dynamic-action plug-in or to display how the Dynamic Actions are structured on a page in a specific application.',
'There are two modes you can select from: the ''Plug-in Showcase'' and the ''Page Designer''.',
'With the ''Plug-in Showcase'' mode you can simply introduce a single plug-in, with all of the attributes and the belonging help texts, it can represent an initialized instance on a page of the plug-in or just the ''empty'' plug-in itself.',
'In the ''Page Designer'' mode you have the option to show the Dynamic Action tree from the Page Designer with the Property Editor. It can be the whole tree, or if you don''t want to show the full set up, you can apply filters on it.',
'The plug-in settings should look and feel the same as in page designer so you can easily see the help text associated with the attribute setting.</p>',
'<p>',
'License: restricted - for FOS internal use only',
'</p>'))
